import React from 'react';
import Sliders from 'components/Controls/Sliders';
import './Controls.scss';

const Controls = () => {
  return (
    <div className='controls-container'>
      <Sliders />
      <input type='checkbox'></input> borders
    </div>
  );
};

export default Controls;
